import React from 'react';
import SearchResultItem from './SearchResultItem';

function SearchResults(props) {
  return (
    <div>
      <div className='search-result'>
        <div className='left'>
          <img src='https://www.superherodb.com/pictures2/portraits/10/100/639.jpg' alt='super pic' />
        </div>
        <div className='right'>
          <h2>BATMAN</h2>
          <div className='biography'>
            <h5>Name: Terry McGinnis</h5>
            <div>Batman II</div>
            <div>The Tomorrow Knight</div>
            <div>The second Dark Knight</div>
            <div>The Dark Knight of Tomorrow</div>
          </div>
        </div>
      </div>
    </div>


  );
}


export default SearchResults;
